script: |
  super -f tsv -I q1685.sql | sort > q1685.out

vector: true

inputs:
  - name: q1685.sql
    data: |
      pragma pg
      SELECT ALL + - ( + 62 ) AS col1 FROM tab1 AS cor0 GROUP BY col0, col2, col1 HAVING - 33 + - col2 IS NOT NULL;
  - name: tab1

outputs:
  - name: q1685.out
    data: |
      -62
      -62
      -62
